	public SquadraAvversaria getSquadra(Giocatore [] giocatori){
				ArrayList <Giocatore> Igiocatori = getGiocatori(giocatori);
		return new SquadraAvversaria (Igiocatori,Igiocatori.get(0).getSquadra());
		
	}
	
	
	
	
	private ArrayList <Giocatore> getGiocatori(Giocatore giocatori[]){
		//continuare da qua..stai creando la squadra avversaria in base alle squadre già create
		
		ArrayList <Giocatore> igiocatori = null;
		String squadradacreare = "";
		//boolean esiste = false;
		for(int i=0;i<squadreesistenti.length;i++){
			for(String j : squadrecreate)

			if(!(j.contains(squadreesistenti[i]))){
				squadradacreare = j;
			}
			
		}
		squadrecreate.add(squadradacreare);
		
		for (int i=0; i<giocatori.length;i++)
			if(giocatori[i].getSquadra().equalsIgnoreCase(squadradacreare)) igiocatori.add(giocatori[i]);
		return igiocatori;
		
		
	}
	
	
	
	
	

	
	public Squadra getSquadraMia(String miasquadra){
		squadrecreate.add(miasquadra);

		return new SquadraUmano (getGiocatoriMia(miasquadra,giocatori),miasquadra);
		
	}
	@SuppressWarnings("null")
	private ArrayList <Giocatore> getGiocatoriMia(String nomesquadra,Giocatore [] giocatori){
		
		ArrayList <Giocatore> igiocatori = null;
		
		
		for (int i=0; i<giocatori.length;i++)
			if(giocatori[i].getSquadra().equalsIgnoreCase(nomesquadra)) igiocatori.add(giocatori[i]);
		return igiocatori;
	}
	
	
